import React, { useEffect , useSelector } from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css'
import logo from '../../img/logo.png';


export function NavBar() {

  return (
        <nav >
        <img src={logo} />

        <Link to='/'> <a className='dropbtn'> iWorld! </a>  </Link>
        <Link to='/home'> <a className='dropbtn'> Home </a> </Link>
        <Link to='/addactivity'><a className='dropbtn'>Actividades </a></Link>
        <Link to='/about'> <a className='dropbtn'> Sobre el Proyecto </a></Link>

    </nav>
    )
};

export default NavBar;
